INSERT into tb_sys_data (id,schoolid,name,email,telephone,dateofvisit,comments,entered_timestamp) values (118,33053,'Bhagya','bhagya@akshara.org.in','9741390704','23-08-2010','ಈ ಶಾಲೆಯಲ್ಲಿ  ಉತ್ತಮವಾದ ವಾತಾವರಣವಿದೆ ಅಕ್ಕ ಪಕ್ಕದಲ್ಲಿ ಮರ ಗಿಡಗಳು ತಂಪಾದ ಗಾಳಿ ತುಂಬಾ ಚೆನ್ನಾಗಿದೆ ಚನ್ನೆನಹಳ್ಳಿ ಶಾಲೆ .ಮತ್ತು ಈ ಶಾಲೆಯಲ್ಲಿ DAILY DUMP COMPOST AT HOME  ನಿಂದ ದಿನ ನಿತ್ಯ ವ್ಯರ್ಥವಾಗುವ ಕಸವನ್ನು ಹಾಕಿ ಗೊಬ್ಬರ ಮಾಡುವ ಮಡಿಕೆಗಳು ಈ ಶಾಲೆಯಲ್ಲಿ ಇದೆ ಇದರಿಂದ ಶಾಲೆ ಸ್ವಚ್ಛವಾಗಿದೆ.','2010-08-27 04:06:21.971545-04');
